import React from 'react'
import './HallOfArt.css'
import axios from 'axios';
import { useEffect } from 'react';


export default function HallOfArt() {

  useEffect(() => {

    var config = {
      method: 'get',
      url: 'http://localhost:8001/upload/getArts',
      headers: {}
    };

    axios(config)
      .then(function (response) {
        console.log(JSON.stringify(response.data));
      })
      .catch(function (error) {
        console.log(error);
      });


  }, [])



  return (
    <div className='container'>
      <div className='container1'>
        <div className='grid-items'><img className='pic' />
          <div><p className='name'>Darrell Staward</p><p className='descript'>Lorem ipsum dolor sit amet consectetur adipisicing elit.</p>
          </div>
        </div>
      </div>


    </div>
  )
}
